CREATE TABLE public.food_type (
	food_type_id bigserial NOT NULL,
	food_type_title varchar(50) NOT NULL,
	CONSTRAINT food_type_food_type_title_key UNIQUE (food_type_title),
	CONSTRAINT food_type_pkey PRIMARY KEY (food_type_id)
);

CREATE TABLE public.nutrient_type (
	nutrient_type_id bigserial NOT NULL,
	nutrient_name varchar(50) NOT NULL,
	nutrient_number varchar(10) NOT NULL,
	unit_name varchar(10) NOT NULL,
	CONSTRAINT nutrient_type_nutrient_name_key UNIQUE (nutrient_name),
	CONSTRAINT nutrient_type_nutrient_number_key UNIQUE (nutrient_number),
	CONSTRAINT nutrient_type_pkey PRIMARY KEY (nutrient_type_id)
);

CREATE TABLE public.food (
	food_id bigserial NOT NULL,
	food_title varchar(100) NOT NULL,
	food_description varchar(500) NULL,
	food_ingredients varchar(2000) NULL,
	food_type_id int8 NOT NULL,
	fdc_id int8 NULL,
	CONSTRAINT food_fdc_id_key UNIQUE (fdc_id),
	CONSTRAINT food_pkey PRIMARY KEY (food_id),
	CONSTRAINT fk_food_food_type_id FOREIGN KEY (food_type_id) REFERENCES food_type(food_type_id)
);


CREATE TABLE public.food_nutrient (
	nutrient_id bigserial NOT NULL,
	amount float4 NOT NULL DEFAULT 0,
	food_id int8 NOT NULL,
	nutrient_type_id int8 NOT NULL,
	CONSTRAINT food_nutrient_pkey PRIMARY KEY (nutrient_id),
	CONSTRAINT fk_food_nutrient_food_id FOREIGN KEY (food_id) REFERENCES food(food_id),
	CONSTRAINT fk_food_nutrient_nutrient_type_id FOREIGN KEY (nutrient_type_id) REFERENCES nutrient_type(nutrient_type_id)
);


